import React from 'react';
import './App.css';
import Page404 from './components/404';
import BBCNews from './components/BBC News';
import Home from './components/Home';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return(  
  <Router>
    <div className='news-app'>
     <nav>
       <ul>
         <li>
           <Link to='/'>Home</Link>
         </li>
         <li>
           <Link to='/BBCNews'>BBC News</Link>
         </li>
         <li>
           <Link to='/Page404'>404 page</Link>
         </li>
       </ul>
     </nav>

     <Switch>
       <Route path='/BBC'>
         <Home />
       </Route>
       <Route path='/BBCNews'>
         <BBCNews />
       </Route>
       <Route path='/Page404'>
         <Page404 />
       </Route>
     </Switch>
    </div>
  </Router>
  );
}

export default App;
